metric_cfgs.tcl:
if {[info commands write_floorplan_gif] eq {}} {return {}}
if {[is_common_ui_mode]} {
  return [write_floorplan_gif -filename snapshot_img_floorplan.[lindex [get_metric name] 1].gif]
} else {
  return [write_floorplan_gif -filename snapshot_img_floorplan.[lindex [um::get_metric name] 1].gif]
}

; #owner: um team
 if {[is_common_ui_mode]} {
   return [get_db flow_run_tag]
 } else {
   if {[is_attribute -obj_type root flow_run_tag]} { 
     return [um::get_obj flow_run_tag]
   }
 }
 return ""

variable ret {}
variable f
variable s
if {[is_common_ui_mode]} {
  foreach {f s} [get_db flow_template_feature_definition] { 
    if {$s eq {enabled}} { 
      lappend ret $f
    }
    if {($s eq {optional}) && [get_db flow_feature_$f]} { 
      lappend ret $f
    }
  } 
} else {
  if {[is_attribute flow_template_feature_definition -obj_type root]} { 
    foreach {f s} [um::get_obj flow_template_feature_definition] { 
      if {$s eq {enabled}} { 
        lappend ret $f
      }
      if {($s eq {optional}) && [um::get_obj flow_feature_$f]} { 
        lappend ret $f
      }
    } 
  }
}
return $ret

if {[is_common_ui_mode]} {
  return [get_db flow_template_type]
} else {
  if {[is_attribute flow_template_type -obj_type root]} { 
    return [um::get_obj flow_template_type]; 
  }
}
return {}


